sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status_code == "200") {
        var responseObj = JSON.parse(inputs.response_body);
        outputs.status = "Success";
    } else {
        outputs.status = "Error";
        outputs.error_message = new GoogleDirErrorHandler()
            .genericErrorHandler(inputs.status_code, inputs.response_body);
    }

})(inputs, outputs);

